#rightbar
{
	float: right;
	width: 250px;
	padding: 40px 30px 0px 30px;
	border: 1px solid #E7DFD7;
	border-radius: 8px;
	background: #F8F8F8;
}



#rightbar ul {
	margin: 0;
	padding: 0;
	list-style: none;
}

#rightbar li {
	margin: 0;
	padding: 0;
}

#rightbar li ul {
	margin: 0px 0px;
	padding-bottom: 50px;
}

#rightbar li li {
	border-bottom: 1px solid #E7DFD7;
	margin: 0px 0px;
	padding: 10px 0px;
	border-left: none;
}

#rightbar li li a {
	color: #3B3B3B;
}

#rightbar li li span {
	display: block;
	padding: 0;
	font-size: 11px;
	font-style: italic;
}

#rightbar h2 {
	padding-bottom: 20px;
	font-size: 1.8em;
	color: #107710;
}

#rightbar p {
	margin: 0px 0px 40px 0px;
	padding: 0px;
	text-align: justify;
}

#rightbar a {
	border: none;
}

#rightbar a:hover {
	text-decoration: underline;
}




